// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import HomePage from './components/HomePage';
import DistrictCourtPage from './components/DistrictCourt';
import HighCourtPage from './components/HighCourt';
import SupremeCourtPage from './components/SupremeCourt';
import CourtOption from './components/CourtOptions'; // Import CourtOption
import StateSelection from './components/StateSelection'; // Import StateSelection
import ViewJudgment from './components/ViewJudgment'; // Import ViewJudgment
import UploadJudgment from './components/UploadJudgment'; // Import UploadJudgment

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        {/* Home Page */}
        <Route path="/" element={<HomePage />} />

        {/* Court selection options */}
        <Route path="/court-option" element={<CourtOption />} />

        {/* State selection */}
        <Route path="/state-selection" element={<StateSelection />} /> {/* Added StateSelection here */}

        {/* Court-specific pages */}
        <Route path="/district" element={<DistrictCourtPage />} />
        <Route path="/high" element={<HighCourtPage />} />
        <Route path="/supreme" element={<SupremeCourtPage />} />

        {/* Judgment viewing and uploading */}
        <Route path="/view-judgment" element={<ViewJudgment />} />
        <Route path="/upload-judgment" element={<UploadJudgment />} />
      </Routes>
    </Router>
  );
}

export default App;
